import logo from './logo.svg';
import './App.css';
import LandingPage from "./components/LandingPage"

function App() {
  return (


    <React.Fragment>
      <BrowserRouter>
        <Routes>
        <Route path="/" element={<LandingPage />} />
        </Routes>
      </BrowserRouter>
    </React.Fragment>
  );
}

export default App;
